import React from "react";
import ChavronIcon from "./ChavronIcon";

const AccordionUpArrow = ({toggleAccordion, setRotate}) => {
  return (
    <div>
      <div onClick={toggleAccordion}>
        <ChavronIcon
          className={`${setRotate}`}
          width={15}
          height={15}
          fill={"#48484A"}
        />
      </div>
    </div>
  );
};

export default AccordionUpArrow;
